INSERT INTO `creators` VALUES (1,NULL,'러닝의 기초를 위해서 여러분에게 기초부터 탄탄하게 배워갈 수 있는 방법에 대해서 공유하고 싶고 같이 성장하고 싶은 러너킴입니다. 우리 함께 열심히 해서 풀코스까지 도전할 수 있는 멋진 도전을 시작해봐요!'),(2,NULL,'수영은 물 속에서 몸을 움직여 수면 위나 수면 아래를 이동하는 운동입니다. 수영은 전신 근육을 강화하고 심폐 기능을 향상시키는 데 도움이 되며, 체력 증진과 스트레스 완화에도 효과적입니다.수영을 시작하기 전에는 먼저 적절한 수영장과 수영복, 안경 등이 필요합니다. 또한 수영을 시작하기 전에는 충분한 스트레칭과 워밍업을 하여 근육 손상을 예방해야 합니다.수영은 초보자부터 전문가까지 다양한 수준의 사람들이 즐길 수 있는 운동입니다. 수영은 자유형, 접영, 배영, 평영 등 다양한 종류가 있으며, 각각의 종류마다 기술적인 요소가 다릅니다.'),(3,NULL,'72 이븐타 칠수 있도록  기본적인 스윙 부터 차근차근 함께 만들어 보아요 ~'),(4,NULL,'소크라 테니스 의 강의 완강하시면 오늘 부터 나도 테니스 왕자 & 공주'),(5,NULL,'화려한 프런트엔드 무대뒤에 숨어 서버통신을 책임지는 다크나이트 백엔드 개발자 malbok KIm'),(6,NULL,'정체를 밝힐순 없지만 해킹침투를 전문으로 가르쳐드립니다'),(7,NULL,'미국계 법률 회사, 독일계 자동차 회사에 재직하며 늘 업무 자동화, 시스템화에 관심이 많았던 저는 꾸준히 프로그래밍에 대한 공부를 지속해오며 업무에 활용하였습니다. 코딩 교육을 통해 새로운 시각과 가치를 제공하고 싶습니다.'),(8,NULL,'누구보다 쉽고 재밌게 프로그래밍 지식을 전달해드립니다. 코딩에 대한 배경지식이 없는 분이라도 충분히 따라올 수 있습니다! 수많은 논의 끝에 범용성이 뛰어난 리액트를 첫 클래스로 열었습니다. 그럼 클래스에서 뵙겠습니다'),(9,NULL,'현재 이탈리아 밀라노에서 미슐랭 3스타 레스토랑을 운영하고 있습니다. 파스타에 대한 각별한 애정으로 이탈리아 요리를 시작했습니다. 과분하게도 운영중인 유튜브 채널이 많은 관심과 사랑을 받게 되었고, 제 영상을 보고 만든 요리가 누군가에게 행복을 전해준다는 뿌듯함에 이 일을 계속하고 있습니다. 수강생분들께는 유튜브에서 알려드리지 않은 더 자세한 레시피를 전해드릴 예정입니다. 저와 함께 작은 이탈리아 주방을 꾸며볼까요?'),(10,NULL,'- 안녕하세요, 건강하고 행복한 한 끼 식사를 요리하는 리라쌤입니다. :) 쿠킹스튜디오를 운영하며 다양한 학생 분들에게 맛있는 레시피를 전파하며 매장 메뉴 컨설팅을 하고 있습니다. 이번 제 수업에서는 샐러드 전문 매장을 오픈하고 싶으신 분, 가족들에게 맛있는 한 끼 식사를 대접하고 싶으신 분들을 위해 다양한 종류의 샐러드 레시피를 준비해 보았어요.'),(11,NULL,'안녕하세요, 셰프 린입니다. \'스시 鮨\'라는 한자는 \'생선 魚\'이 \'맛있다 旨\'는 의미입니다. 신선한 \'생선 魚\'과 잘 지어진 밥이 만나면 \'맛있는 旨\' \'스시 鮨\'가 됩니다. 맛있는 스시 오마카세 레시피, 저와 함께라면 여러분들도 따라 만드실 수 있을 겁니다.'),(12,NULL,'안녕하세요, 김카페입니다. 홈카페에 대한 로망이 있으신 모든 분들을 환영합니다. 저는 카페 창업 경력 6년차, 매장 컨설팅을 겸업하고 있습니다. 개인 카페를 창업하고 싶으신 분들, 카페 메뉴를 개발하고 싶으신 분들 모두 제 클래스 들으시고 도움 받으시길 바라겠습니다.');
/*!40000 ALTER TABLE `creators` ENABLE KEYS */;
