INSERT INTO `lectures` VALUES (1,'러닝 기초부터 탄탄하게 배우자',30000.00,'러닝은 달리기, 조깅, 걷기 등을 포함한 육체적 운동 중 하나입니다. 건강과 체력 증진, 스트레스 감소, 다이어트 효과 등 다양한 이점을 제공합니다.러닝을 시작하려면 먼저 적절한 신발과 의류를 착용해야 합니다. 또한 적절한 스트레칭과 워밍업을 통해 근육 손상을 예방하고 부상을 방지할 수 있습니다.처음 러닝을 시작할 때에는 목표 거리나 시간보다는 천천히 시작하고 꾸준히 지속하는 것이 중요합니다. 첫 몇 주간은 몸의 적응기간이 필요하기 때문에 지나치게 긴 거리나 시간을 뛰지 않도록 주의해야 합니다.','https://images.pexels.com/photos/2803158/pexels-photo-2803158.jpeg',1,'운동 클래스',NULL,1,'2023-03-09 01:03:11',NULL),(2,'수영 누구나 다 할 수 있슴다',40000.00,'우리 수영 수업은 모든 연령층에게 적합한 프로그램으로, 수영을 처음 배우는 초보자부터 전문적인 기술을 익히고자 하는 수영 선수들까지 모두에게 효과적인 수업을 제공합니다.저희 수영 수업에서는 안전한 수영을 위해 물 위에서의 균형과 숨쉬는 방법, 그리고 다양한 수영 스트로크를 배울 수 있습니다. 또한, 수영을 하면서 기본적인 체력과 근력을 향상시키고, 스트레스를 푸는 효과도 누릴 수 있습니다.','https://images.pexels.com/photos/1263348/pexels-photo-1263348.jpeg?auto=compress&cs=tinysrgb&w=1600',2,'운동 클래스',NULL,2,'2023-03-09 01:03:11',NULL),(3,'골프 백돌이  백타 깨기',200000.00,'초보자를 위한 기초 수업은 스윙 자세, 샷 기술, 클럽 선택, 그리고 골프장에서의 기본 규칙과 에티켓을 배우게 됩니다. 또한, 중급자를 위한 과정은 보다 고급 기술과 전략적인 게임 계획을 학습하며, 기존 기술을 개선하고 실력을 향상시키는 데에 초점을 맞춥니다.','https://images.pexels.com/photos/54123/pexels-photo-54123.jpeg?auto=compress&cs=tinysrgb&w=1260&h=750&dpr=1',3,'운동 클래스',NULL,3,'2023-03-09 01:03:11',NULL),(4,'테테레 테테 테니스',100000.00,'- 스윙 기술, 공을 맞추는 기술, 적절한 클러브 선택 등을 배우며, 테니스를 처음 시작하는 분들에게 적합합니다. 또한, 중급자를 위한 과정은 고급 기술, 전략적인 게임 계획, 그리고 실전 전략 등을 학습하며, 기존 기술을 개선하고 실력을 향상시키는 데에 초점을 맞춥니다.테니스는 전신 근육을 사용하는 운동이므로 건강과 체력에 매우 좋습니다. 온라인 테니스 강의를 통해 운동량을 늘리고 건강한 체력과 건강한 습관을 함께 얻을 수 있습니다.','https://images.pexels.com/photos/2618794/pexels-photo-2618794.jpeg?auto=compress&cs=tinysrgb&w=1260&h=750&dpr=1',4,'운동 클래스',NULL,4,'2023-03-09 01:03:11',NULL),(5,'노가다 5년 경력인 내가 백엔드 개발자??',300000.00,'야!! 너두 할수 있어!! 평소에 코딩이 관심이 있던 비전공자도 개발자가 될수 있습니다, 비전공자가 비전공자에게 알기쉽게 가르치는 백엔드 기초코스','https://images.pexels.com/photos/5700184/pexels-photo-5700184.jpeg?auto=compress&cs=tinysrgb&w=1260&h=750&dpr=1',5,'프로그래밍 클래스',NULL,5,'2023-03-09 01:03:11',NULL),(6,'해킹학개론',400000.00,'해킹을 하라고 가르치는게 아닙니다 적을알고 나를 알면 백전백승, 보안성을 높이기위해  정보통신보안법의 허용범위 안에서해커들의 기술,심리상태, 대처법을  알려드립니다.','https://images.pexels.com/photos/1852389/pexels-photo-1852389.jpeg?auto=compress&cs=tinysrgb&w=1260&h=750&dpr=1',6,'프로그래밍 클래스',NULL,6,'2023-03-09 01:03:11',NULL),(7,'파이썬 A to Z 파헤치기!',99000.00,'쉽고 빠르게 학습할 수 있는 30분 요약 강좌로, Python의 기초 개념 부터 간단한 프로젝트까지 할 수 있습니다. 강의 자료도 함께 제공됩니다!','https://images.unsplash.com/photo-1461749280684-dccba630e2f6?ixlib=rb-4.0.3&ixid=MnwxMjA3fDB8MHxzZWFyY2h8Mnx8JUVDJUJEJTk0JUVCJTk0JUE5fGVufDB8fDB8fA%3D%3D&auto=format&fit=crop&w=800&q=60',7,'프로그래밍 클래스',NULL,7,'2023-03-09 01:03:11',NULL),(8,'7일 만에 끝내는 React 입문',110000.00,'React 입문 강의인 만큼 코린이도 쉽게 입문할 수 있도록 준비하였기 때문에 일단 완강을 하겠다는 열정만 있으면 됩니다! React의 핵심 개념 위주로 빠르게 학습하기 원하시는 분들 환영합니다.','https://cdn.pixabay.com/photo/2016/11/30/20/44/computer-1873831__480.png',8,'프로그래밍 클래스',NULL,8,'2023-03-09 01:03:11',NULL),(9,'김슐랭과 함께 하는 이탈리아 가정식 클래스',300000.00,'절대 실패하지 않는 요리 팁을 소개해드립니다. 한 작품을 만들어보는 데는 약 30분에서 1시간 정도 소요됩니다. (육수의 경우 약 3시간 내외) 미슐랭 레스토랑에서 얻은 저만의 경험을 통해 각 지역별 특색있는 메뉴들을 배워봅시다!','https://cdn.pixabay.com/photo/2017/02/15/10/37/salad-2068210__480.jpg',9,'요리,음료 클래스',NULL,9,'2023-03-09 01:03:11',NULL),(10,'맛있는 샐러드 레시피로 몸과 마음도 건강하게 하루 챙기기',200000.00,'다양한 샐러드 토핑과 소스들로 만든 건강한 한끼 식사 레시피를 배우게 될 거예요. 한 작품을 만드는 데에 20-40분 정도가 소요됩니다.','https://images.pexels.com/photos/1211887/pexels-photo-1211887.jpeg?auto=compress&cs=tinysrgb&w=1260&h=750&dpr=2',10,'요리,음료 클래스',NULL,10,'2023-03-09 01:03:11',NULL),(11,'미슐랭 3스타 셰프에게 배우는 스시 오마카세',150000.00,'15년 경력 셰프의 스시 클래스를 만나보세요. 스시를 좋아해도 자주 즐기기엔 부담스러운 게 사실인 스시 오마카세. 클래스 수강 후 직접 만들어보세요! 지인 및 가족들을 집으로 초대해서 대접도 해보세요. 분명 모두가 좋아할 거예요.','https://cdn.pixabay.com/photo/2020/04/04/15/07/sushi-5002639_1280.jpg',11,'요리,음료 클래스',NULL,11,'2023-03-09 01:03:11',NULL),(12,'우리 집을 홈카페로 만들어 보아요',177000.00,'한 작품을 만드는 데에 40~50분 정도가 소요됩니다. 클래스를 따라 차근차근 만드시면 내 집이 근사한 홈카페가 될 수 있습니다. 오픈한 지 6년 된 제 카페 “카페킴”의 시그니처 메뉴부터 대표 메뉴까지 레시피를 공유합니다.','https://cdn.pixabay.com/photo/2017/04/16/18/01/coffee-2235370_1280.jpg',12,'요리,음료 클래스',NULL,12,'2023-03-09 01:03:11',NULL);
